import React, { useEffect } from 'react';
import './ParallaxComponent.css';
import Navbar from './Navbar';

const ParallaxComponent = () => {
    useEffect(() => {
        const handleScroll = () => {
            const scrollPosition = window.pageYOffset;
            const parallaxElement = document.querySelector('.parallax-background');
            if (parallaxElement) {
                const zoomFactor = 1 + scrollPosition * 0.0002; // Adjust the zoom factor to your liking
                parallaxElement.style.transform = `scale(${zoomFactor})`;
            }
        };

        window.addEventListener('scroll', handleScroll);
        return () => window.removeEventListener('scroll', handleScroll);
    }, []);

    return (
        <div className="parallax-container">
            <Navbar />
            <div className="parallax-background">
                <p className='heading'>Building New Age</p>
                <p className="sub-heading">Healthcare With AI</p>
                <p className="sub-text">
                    Assisting medical professionals<br />
                    <span className="inline">in</span> achieving enhanced clinical<br />
                    <span className="inline2">outcomes</span> 
                </p>
                <button className="learn-more-btn">Learn More</button>
            </div>
            
            <div className="table-container">
                <table className="info-table">
                    <thead>
                        <tr>
                            <th>Feature</th>
                            <th>Description</th>
                        </tr>
                    </thead>
                    <tbody>
                        <tr>
                            <td>AI Diagnostics</td>
                            <td>AI-powered tools for accurate and quick diagnostics.</td>
                        </tr>
                        <tr>
                            <td>Patient Management</td>
                            <td>Streamlined patient data management for better healthcare delivery.</td>
                        </tr>
                        <tr>
                            <td>Predictive Analysis</td>
                            <td>Predictive models to foresee and prevent health issues.</td>
                        </tr>
                        <tr>
                            <td>Telemedicine</td>
                            <td>Remote consultation and treatment using telemedicine technologies.</td>
                        </tr>
                    </tbody>
                </table>
            </div>
        </div>
    );
};

export default ParallaxComponent;
